sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        inputs = new JenkinsUtils().trimStringInputs(inputs);
        outputs.build_filter = inputs.build_filter;
        inputs.job_path = inputs.job_path.replace(/^\/|\/$/g, '');
        inputs.job_path = inputs.job_path.replaceAll('/', '/job/');
        outputs.job_path = inputs.job_path;
    } catch (e) {
        new JenkinsUtils().throwError('get_build_number');
    }
})(inputs, outputs);

