sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == '200') {
        outputs.status = "Success";
        outputs.build_number = inputs.response;
    } else {
        outputs = new JenkinsErrorHandler().jobErrorHandler(inputs,
            outputs);
    }
})(inputs, outputs);

